html>
<head>
  <meta charset="utf-8"/>
  <meta name="google" content="notranslate">
  <meta http-equiv="Content-Language" content="en"/>
  <title>Databricks</title>
  <link rel="stylesheet" href="//fonts.googleapis.com/css?family=Source+Code+Pro:400,700">
  <!-- IMPORTANT: Prefer to inline your stylesheet in main.less rather than including it here.
       If you must include it here, then also include it in HTMLExporter.scala:defaultStyleSheets
       if they will be used at all within notebooks (since static notebooks will need them).
       These stylesheets aren't embedded in main.css since they have relative url dependencies -->
  <link rel="stylesheet" href="https://dbc-87b5c687-f181.cloud.databricks.com/lib/css/bootstrap.min.css?buildId=e3b0c44298fc1c149afbf4c8996fb92427ae41e4649b934ca495991b7852b855">
  <link rel="stylesheet" href="https://dbc-87b5c687-f181.cloud.databricks.com/lib/css/feedback.min.css?buildId=e3b0c44298fc1c149afbf4c8996fb92427ae41e4649b934ca495991b7852b855">
  <link rel="stylesheet" href="https://dbc-87b5c687-f181.cloud.databricks.com/lib/jquery-ui-bundle/jquery-ui.min.css?buildId=e3b0c44298fc1c149afbf4c8996fb92427ae41e4649b934ca495991b7852b855">
  <link rel="stylesheet" href="https://dbc-87b5c687-f181.cloud.databricks.com/lib/dropzone/css/basic.css?buildId=e3b0c44298fc1c149afbf4c8996fb92427ae41e4649b934ca495991b7852b855">
  <link rel="stylesheet" href="https://dbc-87b5c687-f181.cloud.databricks.com/css/main.css?buildId=e3b0c44298fc1c149afbf4c8996fb92427ae41e4649b934ca495991b7852b855">
  <!-- Print CSS takes priority over all other stylesheets: include last. -->
  <link rel="stylesheet" href="https://dbc-87b5c687-f181.cloud.databricks.com/css/print.css?buildId=e3b0c44298fc1c149afbf4c8996fb92427ae41e4649b934ca495991b7852b855" media="print">
  <link rel="icon" type="image/png" href="img/favicon.ico" />

  <meta http-equiv="content-type" content="text/html; charset=UTF8">
</head>
<body>

<div id="tooltip" class="hidden">
    <p><span id="value"></span></p>
</div>

<div id="topbar" style="display: none;">
  <div class="tb-title-wrapper tb-title-wrapper-central">
    <span class="tb-title"></span>
    <span class="tb-title-lang"></span>
    <div class="tb-status">
      <span class="tb-status-msg tb-status-msg-error"></span>
      <span class="tb-status-msg tb-status-msg-banner"></span>
      <span class="tb-status-msg tb-status-msg-locked"></span>
      <span class="tb-status-msg tb-status-msg-connecting">Connecting...&nbsp;</span>
      <span class="tb-status-msg tb-status-msg-waiting">Still working...&nbsp;</span>
      <img class="tb-status-spinner" src="/img/spinner.gif" alt="spinner">
    </div>
  </div>
  <div class="tb-title-wrapper tb-title-wrapper-right">
    <div class="tb-title-icons tb-title-icons-right"></div>
    <div class="tb-status presence">
      <span class="tb-status-msg tb-status-presence"></span>
    </div>
  </div>
  <a class="tb-button tb-button-right tb-button-user" title="Account">
    <i class="fa fa-user fa-lg"></i>
  </a>
  <a class="tb-button tb-button-right tb-button-help" title="Help and Support">
    <i class="fa fa-question fa-lg"></i>
  </a>
  <a class="tb-button tb-button-right tb-button-upgrade" title="Upgrade" target="_blank">
    <span>
        <i class="fa fa-arrow-circle-up"></i>Upgrade
    </span>
  </a>
</div>

<div id="sidebar-and-notebook">
  <div id="sidebar" class="sidebar"></div>
  <div id="overallView">
    <div id="context-bar"></div>
    <div id="content"></div>
  </div>
</div>

<div id="filebrowser-popup">
  <div class="filebrowser" style="display: none;"></div>
</div>

<div id="searchpanel-popup">
  <div class="searchpanel" data-panel="Search" style="display: none;" ></div>
</div>

<div id="title-menu" class="tb-title-menu dropdown-menu" role="menu"></div>

<div id="user-menu" class="dropdown-menu"></div>

<ul id="help-menu" class="dropdown-menu">
  <li><a class="guide-button">Documentation</a></li>
  <li><a target="_blank" class="feedback-button">Feedback</a></li>
  <li><a target="_blank" class="forum-button">Forum</a></li>
  <li><a target="_blank" class="support-button">Support</a></li>
</ul>


<div id="hidden" style="display: none;"></div>
<div id="history" style="display: none;"></div>

<div id="debugHelper" style="background-color: white; z-index: 1000; display: none; position: fixed; right: 190px; bottom: 0px;">
  <div id="debugRoute" style="position: fixed; right: 190px; bottom: 40px;"></div>
  <div id="debugCounters" style="position: fixed; right: 190px; bottom: 20px;"></div>
  <a href="https://dbc-87b5c687-f181.cloud.databricks.com/ops/">[OPS]</a>
  <a href="https://dbc-87b5c687-f181.cloud.databricks.com/ops/debug">Debug</a>
  <a href="/ops/metrics">Metrics</a>
  <a href="/ops/requests">Requests</a>
</div>

<!-- A special script that sends back info about the logged-in user -->
<script src="https://dbc-87b5c687-f181.cloud.databricks.com/userinfo/"></script>

<!-- Load main.js -->
<script src="https://dbc-87b5c687-f181.cloud.databricks.com/js/main.js?buildId=e3b0c44298fc1c149afbf4c8996fb92427ae41e4649b934ca495991b7852b855"></script>

</body>
</html>
